SELECT MIN("dim_date"."d_holidayfl") as agg_0 FROM "supplier" LEFT OUTER JOIN "lineorder" ON "supplier"."s_suppkey" = "lineorder"."lo_suppkey" LEFT OUTER JOIN "part" ON "lineorder"."lo_partkey" = "part"."p_partkey" LEFT OUTER JOIN "dim_date" ON "lineorder"."lo_orderdate" = "dim_date"."d_datekey" LEFT OUTER JOIN "customer" ON "lineorder"."lo_custkey" = "customer"."c_custkey"  WHERE ("customer"."c_city" NOT LIKE '%EGY%PT%' OR ("customer"."c_city" != 'INDONESIA8' AND "customer"."c_city" = 'RUSSIA   0')) AND "lineorder"."lo_shippriority" = 0 AND "lineorder"."lo_quantity" BETWEEN 2 AND 33